Written by Joe Casey (#1-8), Rob Liefeld (#8-9), Marat Mychaels (#9)
Art by Derec Donovan (#1-8), Rob Liefeld (#9)
Colored by Bill Crabtree (#1-5)

The Blood is back!  Starring the original celebrity superheroes in their greatest adventures ever! All your favorites are back: Shaft! Die Hard! Badrock! Cougar! Doc Rocket! Johnny Panic! A new administration demands a new Youngblood team, but there are darker forces at work. Is it just another shot at the fame game... or is there a greater destiny involved? Before The Authority... before The Ultimates... there was YOUNGBLOOD. The media blitz begins here!

